function buildFields() {
    this.removeFields()
    this.rows = [];    

    var nextIsWhite = true;
    var fieldSize = 80;

    for (var i=0; i <8; i++) {
        this.rows[i] = [];
        for (var j=0; j <8; j++) {
            var field = this.makeField(i, j, nextIsWhite, fieldSize)
            nextIsWhite = ! nextIsWhite;
            this.rows[i][j] = field;
            this.addMorph(field)
            field.setPosition(pt(i * fieldSize, j * fieldSize))
        }
        nextIsWhite = ! nextIsWhite;
    }


}

215.source:
function makeField(i,j, isWhite, fieldSize) {
    var field = Morph.makeRectangle(0,0,fieldSize,fieldSize);        
    field.pos = [i, j]
    field.isChessField = true;
    field.isWhite = isWhite;
    field.setFill(field.isWhite ? Color.white : Color.black)
    field.disableGrabbing(true)
    field.disableDropping(true)

    field.setLayout
    return field
}
